CREATE TABLE `medicine` (
  `CODE` double NOT NULL,
  `NOM` varchar(100) DEFAULT NULL,
  `DCI1` varchar(100) DEFAULT NULL,
  `DOSAGE1` double DEFAULT NULL,
  `UNITE_DOSAGE1` varchar(100) DEFAULT NULL,
  `FORME` varchar(100) DEFAULT NULL,
  `PRESENTATION` varchar(100) DEFAULT NULL,
  `PPV` double DEFAULT NULL,
  `PH` varchar(100) DEFAULT NULL,
  `PRIX_BR` double DEFAULT NULL,
  `PRINCEPS_GENERIQUE` varchar(100) DEFAULT NULL,
  `TAUX_REMBOURSEMENT` varchar(100) DEFAULT NULL
);



ALTER TABLE `medicine`
  ADD PRIMARY KEY (`CODE`);
COMMIT;

